import React from 'react';

function StatusBar({ money = 1250, level = 8, name = 'John Doe', profilePic }) {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        background: '#ffffff',
        padding: '10px 20px',
        borderRadius: '12px',
        boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
        marginBottom: '15px',
        fontFamily: 'system-ui, sans-serif',
      }}
    >
      {/* Left: Money */}
      <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
        <span style={{ fontSize: '18px' }}></span>
        <span style={{ fontWeight: '600', fontSize: '16px', color: '#111' }}>
          ${money.toLocaleString()}
        </span>
      </div>

      {/* Middle: Level */}
      <div style={{ textAlign: 'center' }}>
        <span style={{ fontSize: '14px', color: '#666' }}>Level</span>
        <div
          style={{
            fontWeight: '700',
            fontSize: '18px',
            color: '#4f46e5',
          }}
        >
          {level}
        </div>
      </div>

      {/* Right: Profile */}
      <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
        <div
          style={{
            width: '38px',
            height: '38px',
            borderRadius: '50%',
            overflow: 'hidden',
            border: '2px solid #ddd',
          }}
        >
          <img
            src={
              profilePic ||
              'https://cdn-icons-png.flaticon.com/512/3135/3135715.png'
            }
            alt="Profile"
            style={{ width: '100%', height: '100%', objectFit: 'cover' }}
          />
        </div>
        <span style={{ fontWeight: '600', color: '#111', fontSize: '15px' }}>
          {name}
        </span>
      </div>
    </div>
  );
}

export default StatusBar;
